description:
 Brian O'Connell, &quot;The Career Survival Guide: Making Your Next Career Move&quot;
2003 | ISBN-10: 0071391304 | 257 pages | PDF | 4,6 MB

Layoffs, mergers, volatile markets, an uncertain future. The Career Survival Guide is an indispensable source of expert insight, analysis, and guidance for today's beleaguered and confused corporate citizen. And it offers a gold mine of sure-fire tips on how to find a mentor, how to get and use insider business information, how to read the tea leaves when your job may be on the line, and how to handle corporate politics.
